import React, { useEffect } from 'react';
import fetch from 'node-fetch'



function HomePage() {
  let data = []

  useEffect(() => {
    fetch('http://localhost:3001/users/all')
    .then(res => {
      return res.json()
    })
    .then(result => {
      result.forEach(item => data.push(item))
      return data
    })
  });

  return (
  <div>
    Welcome to Next.js!
    <div>
      {data.forEach(item => {
        return <div>{item.user_name}</div>
      })}
    </div>
  </div>
  )
}

export default HomePage
